INSERT INTO `v10` (`id`, `years_ago`, `event`) VALUES
(1,	2000000,	'early Homo erectus, direct ancestor of modern humans, coexisting with Australopithecus – soon extinct, and Paranthropus (South Africa): delayed maturity, enlarged brain and smaller teeth'),
(2,	1800000,	'migrations of Homo erectus from Africa to Eurasia (Georgia; to Lantian in northern China by 1.63 million years ago; to Java by 1.5 million years ago); ecological success underwritten by postmenopausal care of young?'),
(3,	1500000,	'earliest control of fire, by Homo erectus (Koobi Fora, Kenya) → uniquely human capability widespread by 400,000 years ago, extending the day by firelight, improving nutritive intake with cooked food'),
(4,	5300,	'start of the Bronze Age (Near East), bronze replacing copper for weapons, tools, nails, utensils; mixing of Eurasian peoples → rapid westward spread of farming, conversion of forest to dairy pasture'),
(5,	1400000,	'replacement of Homo habilis by Homo erectus in Africa'),
(6,	1000000,	'extinction of Paranthropus (South Africa), our last remaining sibling genus'),
(7,	5000,	'global agricultural land use per person peaks at 2.72 ha → 0.66 ha by CE 2016 with improvements in yield'),
(8,	900000,	'Homo antecessor in western Europe (Atapuerca, Spain), closely related to the last common ancestor of Neanderthals, Denisovans and modern humans'),
(9,	700000,	'rise of Homo heidelbergensis in Africa and Europe, possible ancestor of Homo sapiens and Homo neanderthalensis; cooking meat and starchy plants'),
(10,	4800,	'global population of humans passes 50 million; annual energy use per person averages 2,100 kWh, 3× the resting metabolism'),
(11,	500000,	'earliest abstract markings: a zigzag engraving on shell by Homo erectus (Indonesia) → uniquely human capacity for abstraction'),
(12,	500000,	'earliest use of stone-tipped spears, by Homo heidelbergensis (South Africa) for hunting large game'),
(13,	450000,	'rise of Neanderthals Homo neanderthalensis across Europe: similar brain size but fewer neurones compared to modern humans'),
(14,	430000,	'Denisovans diverge from Neanderthals (southern Siberia) → Tibetan Plateau and Laos by 160,000 years ago; subsequent interbreeding, possibly also with Homo erectus'),
(15,	400000,	'multiple hominin dispersals across Arabia (Nefud Desert), during windows of desert greening at four-, three-, two- and one-hundred thousand years ago'),
(16,	4200,	'decline of Bronze-Age civilisations in Egypt, Greece and Mesopotamia, and terminal decline of Indus Valley civilisation, caused by centuries of drought beginning c. 2200 BCE'),
(17,	320000,	'long-distance transport of obsidian for fine blades and points, and ochre for pigments (Kenya) → technological transition to Middle Stone Age during intensifying climate swings'),
(18,	4000,	'extinction of last remnant population of woolly mammoths, on Wrangle Island, Arctic Sea'),
(19,	315000,	'earliest representatives of our species, Homo sapiens (Jebel Irhoud, Morocco): facial and dental structure similar to modern humans, yet still archaic elongation of the braincase'),
(20,	4000,	'earliest use of coal as fuel (Inner Mongolia and Shanxi, China), for smelting copper, cooking, heating → peak global coal production of 8.2 billion tonnes/year in CE 2013?'),
(21,	300000,	'wooden spears and lances used by Homo heidelbergensis for hunting large herbivores (Schöningen, Germany)'),
(22,	3800,	'earliest extraction and working of iron (Anatolia) → alloying with carbon to make steel in Cyprus by 1100 BCE'),
(23,	250000,	'replacement of Homo heidelbergensis by Homo neanderthalensis in Europe, and by Homo sapiens in Africa over the subsequent 100,000 years'),
(24,	3050,	'start of the Iron Age (Aegean; Britain by 800 BCE), iron replacing bronze for tools and weapons'),
(25,	210000,	'Homo sapiens enter Eurasia (Greece): first of multiple dispersals out of Africa by humans with early modern traits, including globular braincase and descended larynx facilitating spoken language'),
(26,	3000,	'use of hydraulic plaster, mixing lime with silicates (Tell es-Safi/Gath, Israel) → concrete in Ancient Rome by CE 70, the dominant building material of modern times'),
(27,	200000,	'earliest adhesive: birch tar used by Neanderthals for hafting stone tools (Campitello, Italy) → pyrotechnology'),
(28,	2350,	'development of formal systems of reasoning, by logical deduction from axioms and postulates (Aristotle, Greece) → scientific disciplines'),
(29,	176000,	'earliest built constructions: underground edifices made from broken stalagmites by Neanderthals (Bruniquel Cave, France) → material culture'),
(30,	171000,	'earliest record of fire technology, by Neanderthals: boxwood digging sticks with shafts worked smooth by controlled burning (Poggetti Vecchi, Italy)'),
(31,	110000,	'last appearance of Homo erectus (Ngandong, Java), 1.89 million years after its first appearance → the longest enduring species of human'),
(32,	2300,	'first hypothesis that Earth revolves around the Sun (Aristarchus of Samos, Greece, reported in Archimedes’ The Sand Reckoner, c. 260 BCE'),
(33,	100000,	'interbreeding of Homo sapiens with Homo neanderthalensis (Siberia) → accumulation of modern traits through gene flow'),
(34,	1750,	'firing of natural gas in southwest China, to boil brine for salt (Bowu zhi c. 290), and to pipe into homes for lighting (Huayang Guo Zhi c. 340) → 3.9 trillion m³/year of global gas extraction by 2018 and rising'),
(35,	78000,	'earliest symbolic human burial, a 3-year old Homo sapiens (Panga ya Saidi Cave, Kenya): funerary practices by our ancestors'),
(36,	1750,	'use of mineral oil in central China, to lubricate axles and to seal water tanks (Bowu zhi c. 290, reported in Shui Jing Zhu c. 500) → 5.0 billion tonnes/year of global oil extraction by 2018: peak production?'),
(37,	64800,	'earliest symbolic cave paintings by Neanderthals (La Pasiega Cave, Spain)?'),
(38,	1700,	'beginning of central Europe’s 300-year Migration Period: cultural and socioeconomic turmoil coinciding with climatic variability; Mongolian Avar warriors overwhelming the eastern Roman Empire'),
(39,	1500,	'crop failures across the northern hemisphere caused by volcanic eruptions in Iceland; then bubonic plague → century of economic stagnation'),
(40,	1300,	'over 700 European cities exceed 1,000 inhabitants in CE 700, of which only Constantinople exceeds 100,000 → 22 such cities by 1800, thereafter rising exponentially to 665 by 2000'),
(41,	60000,	'range expansion of modern humans out of Africa into Eurasia, beginning 60,000 years ago and enduring 10,000 years'),
(42,	676,	'bubonic plague caused by the Black Death bacillus Yersinia pestis kills a third of the human population across much of Europe, 1346-53; originating in Kyrgyzstan or the Himalayas, transmitted by rats and their fleas'),
(43,	480,	'global population of humans passes 500 million; annual energy use per person averages 9,800 kWh, 14× the resting metabolism'),
(44,	54000,	'modern humans, Homo sapiens, settling briefly in western Europe (Grotte Mandrin, France)? – preceded by and preceding Neanderthal settlements'),
(45,	253,	'invention of the first cost-effective steam engine (James Watt, Britain, 1769) → powered machinery, Industrial Revolution'),
(46,	41500,	'most recent reversal of Earth’s magnetic poles, lasting 500 years, decreasing stratospheric ozone, driving global climate shifts and extinction events'),
(47,	242,	'mass production of spun textiles, mechanised by water power; coal-fired and steam-powered production of iron and steel (beginning Britain, c. 1780) → economies of scale, rising polarisation of rich and poor nations, dominance of fossil fuels'),
(48,	40000,	'anatomically modern humans replace Neanderthals, our last remaining sibling species'),
(49,	215,	'concept of the mutual dependence of physical, climatological and organic phenomena (Alexander von Humboldt, Prussia, 1807) → science of biogeography'),
(50,	23000,	'first domestication: dogs from grey wolves Canis lupus (Siberia or Japan), for companionship, hunting technology, and pulling sledges → 700 million dogs by CE 21ˢᵗ century'),
(51,	200,	'first prediction of Earth’s greenhouse effect (Joseph Fourier, France, 1822; tested empirically by Eunice Foote, USA, 1856, John Tyndall, Ireland, 1859) → CO₂ emissions from fossil fuels cause global climate warming'),
(52,	19000,	'replacement of early modern humans across Eurasia by the ancestors of today’s populations'),
(53,	162,	'factory production of internal-combustion engines (Jean Lenoir, Belgium, 1860; user manual 1864) → electricity generators, vehicular transport'),
(54,	15000,	'colonisation and occupation of North America by humans, from northeastern Siberia over the Bering land bridge, bringing their dogs'),
(55,	12800,	'climate shift contributing to megafaunal extinctions and human cultural changes (Younger Dryas): triggered by a comet airburst over North America and Europe?'),
(56,	12000,	'extinction of megafauna including woolly mammoths from continental Eurasia and North America, caused by human hunting and climate change'),
(57,	140,	'first commercially viable power stations, coal-fired (London and New York, 1882) → electrical grid; fossil fuels providing 63% of global electricity generation by 2019'),
(58,	11700,	'start of the Holocene Epoch within the Quaternary Period, characterised by warm and stable climate until the late CE 20ᵗʰ century'),
(59,	140,	'first hydroelectric power station (Jacob Schoellkopf, USA, 1882) → megadams replumbing the world’s major rivers from the 1950s; 16% of global (and 98% of Norway’s) electricity generation by 2019'),
(60,	10100,	'global population of humans passes 5 million; annual energy use per person averages 1,700 kWh, 2.4× the resting metabolism'),
(61,	138,	'first rooftop photovoltaic solar array (Charles Fritts, USA, 1884) → rising to 3% of global electricity generation by 2019'),
(62,	10000,	'continental ice-sheets withdraw from Europe and North America'),
(63,	135,	'first wind-powered turbine for production of electricity (James Blyth, UK, 1887) → rising to 5% of global electricity generation by 2019'),
(64,	8500,	'earliest mining of metal: heating, hammering and grinding copper into projectile points (Great Lakes, North America)'),
(65,	109,	'introduction of factory assembly lines for mass production of cars (Ford Model T, USA, 1913), dedicating one worker to each step → dehumanising labour; affordable cars for labourers'),
(66,	7900,	'start of the Copper Age (Fertile Crescent), spread of copper smelting for weapons and tools'),
(67,	100,	'invention of leaded petrol (General Motors, USA, 1922), improving engine performance, causing epidemics of heart disease, stroke, cancer, and developmental delays in children → global elimination by 2021'),
(68,	7500,	'extraordinarily large influx of cosmic rays from an abnormal Sun, possibly caused by solar proton events → potential for DNA damage on a global scale'),
(69,	90,	'discovery of neutrons (James Chadwick, UK, 1932), with protons constituting the nuclei of atoms → nuclear fission of uranium by 1938; nuclear chain reactions; atomic bombs and nuclear energy'),
(70,	7000,	'domestication of donkeys (East Africa), spreading rapidly throughout Eurasia → first land-based transport: pack animals for transporting materials and water, transforming society'),
(71,	68,	'first nuclear power plant (Obninsk, USSR, 1954) → advent of clean energy: 10% of global electricity generation in 2019; radioactive waste; nuclear catastrophes, including Chernobyl, Ukraine, 26/4/1986'),
(72,	37,	'discovery of a human-induced hole in the stratospheric ozone layer (1985) → increase in UV-B radiation at Earth’s surface, changing climate, causing DNA damage to phytoplankton and plants; potential forest sterility and skin cancers'),
(73,	36,	'global population of humans passes 5 billion; annual energy use per person averages 18,300 kWh, 26× the resting metabolism'),
(74,	35,	'global agreement to ban hydrochlorofluorocarbons and other ozone depleting substances (Montreal Protocol, 1987), the only UN protocol to be ratified by every country on Earth → punctuated recovery of stratospheric ozone, slowing Earth’s warming'),
(75,	34,	'first assessment that global climate warming has begun (James Hansen, Senate testimony to US Congress, 23/6/1988) → creation of the IPCC, 1988; human imperative to stabilise climate change'),
(76,	19,	'a heatwave across Europe causes 70,000 additional deaths in summer 2003, then with a return time of thousands of years → 100 years by 2015; rising frequency of record-shattering climate extremes, including marine heatwaves'),
(77,	9,	'atmospheric concentrations of CO₂ exceed 400 ppm for the first time in at least 3 million years, an accelerating rise (NOAA, Hawaii, 5/2013) → race for technologies to capture and use CO₂'),
(78,	7,	'tipping point in industry-wide momentum towards electric vehicles during mid-2010s, when still comprising 2% of market share, spread by investor confidence under strengthening regulation of fossil fuels'),
(79,	7,	'three trillion trees on Earth (2015, cf. 6.6 trillion at the start of human civilisation), 15 billion culled annually → forest covering a quarter of global land area, declining in extent and diversity, driven down by commodity production, wildfires, urbanisation'),
(80,	6,	'coldest ground surface temperature on Earth: −﻿110.9°C (central-eastern Antarctica, 2016); once temperate rainforests, now dry and salty antarctic soils uninhabitable even to microbes'),
(81,	6,	'global land and ocean surface temperature for 2016 reaches 0.99°C above the 1951-1980 mean, Earth’s warmest year on record to date → roadmap for decarbonisation, implicating lifestyle choices'),
(82,	5,	'accumulation of plastic waste since 1950 exceeds 5 billion tonnes in landfills and the natural environment by 2017, more than 10× global human biomass → pervasive microplastics across the globe; paucity of options for mitigating harm'),
(83,	4,	'sixfold increase in annual ice loss from Antarctica and Greenland over 25 years to 2018 → sea-levels to rise 40-80 cm by 2100 under scenarios of low-high greenhouse gas emissions, displacing 190-630 million people'),
(84,	4,	'hottest ground surface temperature on Earth: 80.8°C (Lut Desert, Iran, 2018; Sonoran Desert, Mexico, 2019), too hostile for plant life'),
(85,	3,	'Britain generates more electricity from zero-carbon sources than from fossil fuels for the first time since the Industrial Revolution (UK National Grid, 6/2019); fossil fuels still provide 84% of global primary energy'),
(86,	3,	'first global climate strike (20/9/2019), led by school children and joined by millions of people with justified concerns → world scientists warn of a climate emergency'),
(87,	2,	'highest recorded air temperature on Earth: 54.4°C in Death Valley (California, USA, 16/8/2020); emergence of intolerable heat, particularly for urban populations, exacerbated by air conditioning, mitigated by greenery'),
(88,	2,	'global land and ocean surface temperature for 2020 exceeds 1°C above the 1951-1980 mean for the first time, 1.2°C above the pre-industrial 1850-1900 baseline, with 2011-2020 the 4ᵗʰ decade in succession to claim warmest average temperature'),
(89,	1,	'worldwide acceleration of glacier melt, now at twice the speed of 20 years ago → explaining one-fifth of the rate and acceleration in sea-level rise during the 21ˢᵗ century'),
(90,	1,	'tropical forests turn from CO₂ sink to source in south-eastern Amazonia by 2021, linked to intensifying dry seasons, deforestation and rising frequency of fires'),
(91,	1,	'Earth’s hottest month on record (NOAA, July 2021): rising frequency of climate anomalies → need for actions to trigger positive tipping towards global sustainability through self-reinforcing shifts in behaviour'),
(92,	1,	'human activities have unequivocally warmed atmosphere, ocean and land, intensifying heatwaves, droughts and floods; global warming will exceed 2°C without immediate, rapid and large-scale reductions in greenhouse-gas emissions (IPCC, 2021): a reality check for policy makers'),
(93,	1,	'the world ocean reaches its hottest ever recorded in 2021, for the third year and seventh decade in a row, contributing to coral bleaching and sea-level rise; fuelling marine heatwaves, cyclones and hurricanes'),
(94,	0,	'time has almost run out for averting global climate catastrophe (IPCC, 2022): mitigation still cheaper than adaptation, by switching immediately and comprehensively to carbon-free energy and extracting atmospheric carbon'),
(95,	0,	'record-breaking heatwaves heralding extreme droughts in China and western Europe, and flooding in Pakistan that displaces 33 million people');
